// more returns x>y.
func more(x, y V) V {
	if x.IsI() {
		return moreIV(x.I(), y)
	}
	if x.IsF() {
		return moreFV(x.F(), y)
	}
	switch xv := x.bv.(type) {
	case S:
		return moreSV(xv, y)
	case *AB:
		return moreABV(xv, y)
	case *AF:
		return moreAFV(xv, y)
	case *AI:
		return moreAIV(xv, y)
	case *AS:
		return moreASV(xv, y)
	case *AV:
		switch yv := y.bv.(type) {
		case *Dict:
			return newDictValues(yv.keys, more(x, NewV(yv.values)))
		case array:
			if yv.Len() != xv.Len() {
				return panicLength("x>y", xv.Len(), yv.Len())
			}
			return dyadAVarray(xv, yv, more)
		}
		return dyadAVV(xv, y, more)
	case *Dict:
		yv, ok := y.bv.(*Dict)
		if ok {
			r := dictArith(xv, yv, more)
			if r.IsPanic() {
				return ppanic("d>d", r)
			}
			return r
		}
		return newDictValues(xv.keys, more(NewV(xv.values), y))
	default:
		return panicType("x>y", "x", x)
	}
}

